import React from 'react';
import CategorizedData from './CategorizedData';

const ExchangeData = () => {
  return (
    <div>
      <h1 className="text-center text-3xl font-semibold mb-4">Exchange Data</h1>
      <CategorizedData endpoint="exchange" />
    </div>
  );
};

export default ExchangeData;
